import './App.css';
import Header from "../Header/Header"
import Slide from "../Slide/Slide"
import Stocks from '../Stocks/Stocks';
import Advantages from '../Advantages/Advantages';

function App() {
  return (
    <div className='App'>
      <Header />
      <Slide />
      <Stocks />
      <Advantages />
    </div>
  );
}

export default App;
